import random

def random_dalvik_ua_bd(seed=None):
    """
    Return a realistic Dalvik-style User-Agent tuned for Bangladesh servers.
    Usage: print(random_dalvik_ua_bd())
    If seed is provided, results are reproducible.
    """
    if seed is not None:
        random.seed(seed)

    android_versions = ["9", "10", "11", "12", "13", "14"]
    dalvik_versions = ["2.1.0", "2.0.0", "1.4.0"]  # common Dalvik-ish versions seen in UAs

    devices = [
        # (manufacturer, model, build)
        ("Xiaomi", "Redmi Note 11", "RP1A.200720.011"),
        ("Xiaomi", "Redmi 10", "RP1A.200720.011"),
        ("Samsung", "Galaxy A12", "RP1A.200720.012"),
        ("Samsung", "Galaxy A03s", "RP1A.200720.012"),
        ("TECNO", "Spark 8", "RP1A.200720.011"),
        ("Infinix", "Hot 10", "RP1A.200720.011"),
        ("Realme", "C21", "RP1A.200720.012"),
        ("OPPO", "A54", "RP1A.200720.011"),
        ("Vivo", "Y12s", "RP1A.200720.012"),
        ("Google", "Pixel 4a", "RP1A.200720.011"),
    ]

    # common screen dims / density groups (approx)
    screen_profiles = [
        ("1080", "2400", "2.0"),
        ("720", "1600", "1.5"),
        ("1080", "2340", "2.0"),
        ("720", "1520", "1.5"),
        ("720", "1640", "1.5"),
    ]

    carriers = [
        "Grameenphone", "Banglalink", "Robi", "Airtel", "Teletalk", "Telenor"
    ]

    locales = ["bn_BD", "en_GB", "en_US"]

    android = random.choice(android_versions)
    dalvik = random.choice(dalvik_versions)
    manu, model, build = random.choice(devices)
    width, height, density = random.choice(screen_profiles)
    fb_app = random.choice(["FBAN/FB4A;FBAV/400.0.0.0.0;", "FBAN/FB4A;FBAV/341.0.0.12.117;", ""])
    carrier = random.choice(carriers)
    locale = random.choice(locales)

    # Compose FBDM (density/width/height) segment similar to FB-style UAs
    fbdm = f"{{density={density},width={width},height={height}}}"

    # Some UAs include network operator (FBCR) or manufacturer (FBMF)
    fb_parts = []
    if fb_app:
        fb_parts.append(fb_app)
    fb_parts.append(f"FBBV/{random.randint(10000000,99999999)};")
    fb_parts.append(f"FBDM/{fbdm};")
    fb_parts.append(f"FBLC/{locale};")
    fb_parts.append(f"FBCR/{carrier};")
    fb_parts.append(f"FBMF/{manu};")
    fb_info = "".join(fb_parts)

    ua = (
        f"Dalvik/{dalvik} (Linux; U; Android {android}; {model} Build/{build}) "
        f"[{fb_info}]"
    )

    # Clean up accidental double spaces
    return " ".join(ua.split())

